import React from 'react';


const Pictures = (props) => {
	console.log(props.abilities);
	var pics = []
    props.ids.forEach(id=>{
           pics.push(<img key = {id} alt='poke' src={`https://pokeres.bastionbot.org/images/pokemon/${id}.png/`} width='200' height='200' />)
    })

    return pics ; 
}



export default Pictures;
